import React from 'react';
import { NavLink } from 'react-router-dom';


export default function NavBar() {
  return (
    <div>
        <nav class="navbar navbar-dark bg-dark">
        <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarText" aria-controls="navbarText" aria-expanded="false" aria-label="Toggle navigation">
            <span class="navbar-toggler-icon"></span>
        </button>
            <NavLink to="/articles" activeClassName="selected" className="">Articles</NavLink>
            <NavLink to="/" activeClassName="selected" className="">Home</NavLink>
            <NavLink to="/articles/new" activeClassName="selected" className="">Create</NavLink>
            <NavLink to="/articles">Articles</NavLink>
        </nav>
    </div>
  )
}
